import React from 'react'
import { useParams } from 'react-router'

function EditarUsuarios(){

    const params = useParams()

    return (
        <div>
            <h2>Editar Usuarios</h2>
            <h3>El ID del usuario es: {params.idusuario}</h3>
        </div>
    )
}
export default EditarUsuarios
